Storyline:

Shane rides into a conflict between cattleman Ryker and a bunch of settlers, like the Starretts, whose land Ryker wants. When Shane beats up Ryker's man Chris, Ryker tries to buy him. Then Shane and Joe take on the whole Ryker crew. Ryker sends to Cheyenne for truly evil gunslinger Wilson. We wonder about Shane's relation to Joe's wife Marian. Shane must clear out all the guns from the valley before he can ride off with Joey hollering &quot;Shane ... Shane ... Come Back!&quot;
